&amp;lt;br&amp;gt;&amp;lt;/div&amp;gt;&amp;lt;div style=&amp;quot;text-align: justify; font-size: 18px;&amp;quot;&amp;gt;&amp;lt;br&amp;gt;&amp;lt;/div&amp;gt;&amp;lt;div style=&amp;quot;text-align: justify; font-size: 16px;&amp;quot;&amp;gt;&amp;lt;ul style=&amp;quot;&amp;quot;&amp;gt;&amp;lt;li style=&amp;quot;&amp;quot;&amp;gt;&amp;lt;font style=&amp;quot;font-size: 16px;&amp;quot;&amp;gt;É um processo utilizado para validar um estabelecimento comercial com o Autorizador.&amp;lt;/font&amp;gt;&amp;lt;/li&amp;gt;&amp;lt;li style=&amp;quot;&amp;quot;&amp;gt;&amp;lt;font style=&amp;quot;font-size: 16px;&amp;quot;&amp;gt;Ele é utilizado para indicar se uma carga de tabelas deve ser iniciada, o que só deve ocorrer se a versão da tabela no Autorizador for diferente da versão na &amp;lt;b style=&amp;quot;&amp;quot;&amp;gt;FEPAS&amp;amp;nbsp;&amp;lt;/b&amp;gt;&amp;lt;span style=&amp;quot;&amp;quot;&amp;gt;(Front-End Payment Authorization System).&amp;lt;/span&amp;gt;&amp;lt;/font&amp;gt;&amp;lt;/li&amp;gt;&amp;lt;li style=&amp;quot;&amp;quot;&amp;gt;&amp;lt;font style=&amp;quot;font-size: 16px;&amp;quot;&amp;gt;O Logon deve ser realizado pelo menos uma vez ao dia ou em situações específicas, como quando o &amp;lt;b&amp;gt;TEF &amp;lt;/b&amp;gt;(Transferência Eletrônica de Fundos) é colocado em operação ou diariamente em um horário específico.&amp;lt;/font&amp;gt;&amp;lt;/li&amp;gt;&amp;lt;li style=&amp;quot;&amp;quot;&amp;gt;&amp;lt;font style=&amp;quot;font-size: 16px;&amp;quot;&amp;gt;A &amp;lt;b&amp;gt;FEPAS &amp;lt;/b&amp;gt;envia a versão atual das tabelas carregadas no estabelecimento comercial durante o processo de Logon.&amp;lt;/font&amp;gt;&amp;lt;/li&amp;gt;&amp;lt;li style=&amp;quot;&amp;quot;&amp;gt;&amp;lt;font style=&amp;quot;font-size: 16px;&amp;quot;&amp;gt;O Autorizador verifica esses dados e indica a necessidade de realizar uma carga de tabelas se as tabelas estiverem desatualizadas.&amp;lt;/font&amp;gt;&amp;lt;/li&amp;gt;&amp;lt;li style=&amp;quot;&amp;quot;&amp;gt;&amp;lt;font style=&amp;quot;font-size: 16px;&amp;quot;&amp;gt;Se as tabelas da &amp;lt;b&amp;gt;FEPAS &amp;lt;/b&amp;gt;estiverem desatualizadas, o processo de carga de tabelas é iniciado enviando uma mensagem 0800 com o bit 70 = 800, indicando o início do carregamento.&amp;lt;/font&amp;gt;&amp;lt;/li&amp;gt;&amp;lt;li style=&amp;quot;&amp;quot;&amp;gt;&amp;lt;font style=&amp;quot;font-size: 16px;&amp;quot;&amp;gt;O Autorizador responde à mensagem enviando informações nos bits 47, 48 e 62.&amp;lt;/font&amp;gt;&amp;lt;/li&amp;gt;&amp;lt;/ul&amp;gt;&amp;lt;/div&amp;gt;\&quot; style=\&quot;text;html=1;strokeColor=none;fillColor=none;align=center;verticalAlign=top;whiteSpace=wrap;rounded=0;\&quot; parent=\&quot;WIyWlLk6GJQsqaUBKTNV-1\&quot; vertex=\&quot;1\&quot;&gt;&lt;mxGeometry x=\&quot;9\&quot; y=\&quot;1170\&quot; width=\&quot;1454\&quot; height=\&quot;288\&quot; as=\&quot;geometry\&quot;/&gt;&lt;/mxCell&gt;&lt;mxCell id=\&quot;K_FW4SWD4WvgckGDn0Mu-1\&quot; value=\&quot;FEPAS\&quot; style=\&quot;rounded=1;whiteSpace=wrap;html=1;fillColor=none;\&quot; parent=\&quot;WIyWlLk6GJQsqaUBKTNV-1\&quot; vertex=\&quot;1\&quot;&gt;&lt;mxGeometry x=\&quot;39\&quot; y=\&quot;1590\&quot; width=\&quot;80\&quot; height=\&quot;120\&quot; as=\&quot;geometry\&quot;/&gt;&lt;/mxCell&gt;&lt;mxCell id=\&quot;K_FW4SWD4WvgckGDn0Mu-2\&quot; value=\&quot;Autorizador&amp;lt;br&amp;gt;E-ctare\&quot; style=\&quot;rounded=1;whiteSpace=wrap;html=1;fillColor=none;\&quot; parent=\&quot;WIyWlLk6GJQsqaUBKTNV-1\&quot; vertex=\&quot;1\&quot;&gt;&lt;mxGeometry x=\&quot;479\&quot; y=\&quot;1590\&quot; width=\&quot;80\&quot; height=\&quot;120\&quot; as=\&quot;geometry\&quot;/&gt;&lt;/mxCell&gt;&lt;mxCell id=\&quot;K_FW4SWD4WvgckGDn0Mu-3\&quot; value=\&quot;\&quot; style=\&quot;endArrow=classic;html=1;rounded=0;entryX=0;entryY=0.333;entryDx=0;entryDy=0;entryPerimeter=0;\&quot; parent=\&quot;WIyWlLk6GJQsqaUBKTNV-1\&quot; target=\&quot;K_FW4SWD4WvgckGDn0Mu-2\&quot; edge=\&quot;1\&quot;&gt;&lt;mx
